import Navbar from './Navbar'
import Head from 'next/head'
const Layout = () => {
    return (
        <div>
            <Head>
                <title>News App</title>
                <link rel="stylesheet" href="https://bootswatch.com/4/darkly/bootstrap.min.css" ></link>
            </Head>
            <Navbar/>
        </div>
    );
}

export default Layout;
